window.bookSummaryJSON = "<p><b>These heroes are 100 percent raw, dangerous, and...undeniably sexy.</b></p> <p><i>New York Times</i> best-selling authors Sherrilyn Kenyon, Dianna Love, Cindy Gerard, and Laura Griffin mix seduction and suspense in three irresistible romantic adventures. </p> <p>From sultry international jungles to the rugged terrain of the American Southwest, join the larger-than-life, scorching-hot alpha heroes of the Bureau of American Defense, Black Ops, Inc., and the US Navy SEALs for all the pulse-pounding, heart-racing, toe-curling excitement. They're cool under pressure, steamy under the sheets, and when the enemy strikes, there's not a lethal mission these gorgeous men can't handle....</p> <p><i>Just Bad Enough</i> by Sherrilyn Kenyon and Dianna Love</p> <p><i>Leave No Trace</i> by Cindy Gerard</p> <p><i>Unstoppable</i> by Laura Griffin</p>"; 
